import React from "react";

const styles = {
    photo: {
        height: 170,
        width: 170
    }
}

const Photo = props => (

    <li className="row">
        <div className="col-lg-2 col-md-2 col-sm-3 col-xs-4" style={props}></div>
    </li>

);

export default Photo;
